/**
* @author
* @function Projects
**/

const Projects = (props) => {
  return(
    <section className="Phme">
        <div className="Pside"><Sidebar>Projects Sidebar</Sidebar></div>
        <div className="Pmain"><Mainpage>Projects</Mainpage></div>
        <div className="Pmain-2"><Mainpage>Projects</Mainpage></div>
        <div className="Pside-2"><Sidebar>Projects Sidebar</Sidebar></div>
    </section>
   )

 }

export default Projects
